- input: "TEXT\x1CC00514653\x1CT1\x1C\x1CF3XA\x1C\"This amended report responds to
    a Request for Additional Informatino letter (RFAI) dated 12/7/2012, which requests
    information on three items, each of which is addressed in turn.  1. Schedule A
    Aggregate YTD Totals--The Committee failed to include aggregate information for
    Schedule A, Line 15 transactions, offsets to operating expenses. The amended report
    includes those aggregate totals. The Committee notes that these are not contributions
    as suggested by the RFAI, but offsets to operating expenses.  2. Late 24 Hour
    Report (Schedule E)--WIth respect to the three expenditures identified, the Committee
    notes the following: Nebo Media 8/3/12, $42,085.00. The Committee filed an Independent
    Expenditure report on 9/19 and included memo text indicating that the report was
    filed late and that the error had been discovered in the process of preparing
    the Sept 20 Monthly Report. The Committee regrets its error and corrected it on
    its own initiative once discovered. Spectrum Marketing Companies 8/24, $5,646.72,
    and Spectrum Marketing Companies 8/27, $5,646.72. The Committee regrets its error
    in filing these reports late. They should have been filed on 8/25 and 8/28 and,
    as such, were 4 days and 1 day late, respectively.  3. Schedule E YTD Per Election
    Per Office Sought Totals--The Committee made an error in calculating the year-to-date
    expenditures opposins Nancy Cassis in the 2012 Primary in MI-11. The final two
    expenditures on 8/6 were not added to the total expended on 8/3, but to the total
    form 8/2. The Committee has corrected this error and its calculation agrees with
    the FEC's calculation.\"\n"
